		pix(d["pos"][0], d["pos"][1], d["color"])
	end
end


def draw_fast_map()
	x = 0
	$fast_map_data.each do
		|fmd|
		if fmd.kind_of?(Array) then
			y = 0
			fmd.each do
				|c|
				color = c
				if c == nil then
					color = 0
				end
				pix(x, y, color)
				y += 1
			end
		end
		x += 1
	end
end


